import React, { useState, useEffect } from 'react';
import { useNavigate, useParams } from 'react-router-dom';
import axios from 'axios';

const EditMocion = () => {
    const { id } = useParams();
    const [topico, setTopico] = useState('');
    const [tiempoDel, setTiempoDel] = useState('');
    const [cantDel, setCantDel] = useState('');
    const [sesion, setSesion] = useState('');
    const [fecha, setFecha] = useState('');
    const [delegadoId, setDelegadoId] = useState('');
    const [comiteId, setComiteId] = useState('');
    const [delegados, setDelegados] = useState([]);
    const [comites, setComites] = useState([]);
    const navigate = useNavigate();

    useEffect(() => {
        // Fetch the mocion data
        const fetchMocion = async () => {
            try {
                const response = await axios.get(`http://localhost:8080/mociones/${id}`);
                const mocion = response.data;
                setTopico(mocion.Topico);
                setTiempoDel(mocion.Tiempo_Del);
                setCantDel(mocion.Cant_Del);
                setSesion(mocion.Sesion);
                setFecha(mocion.Fecha.split('T')[0]);
                setDelegadoId(mocion.DelegadoID);
                setComiteId(mocion.ComiteID);
            } catch (error) {
                console.error('Error fetching mocion:', error);
            }
        };

        // Fetch delegados and comites data
        const fetchData = async () => {
            try {
                const [delegadosResponse, comitesResponse] = await Promise.all([
                    axios.get('http://localhost:8080/delegados'),
                    axios.get('http://localhost:8080/comites')
                ]);
                setDelegados(delegadosResponse.data);
                setComites(comitesResponse.data);
            } catch (error) {
                console.error('Error fetching data:', error);
            }
        };

        fetchMocion();
        fetchData();
    }, [id]);

    const handleSubmit = async (e) => {
        e.preventDefault();

        const updatedMocion = {
            Topico: topico,
            Tiempo_Del: parseInt(tiempoDel),
            Cant_Del: parseInt(cantDel),
            Tiempo_Total: parseInt(tiempoDel) * parseInt(cantDel),
            Sesion: sesion,
            Fecha: new Date(fecha).toISOString(),
            DelegadoID: parseInt(delegadoId),
            ComiteID: parseInt(comiteId)
        };

        try {
            await axios.put(`http://localhost:8080/mociones/${id}`, updatedMocion);
            navigate('/');
        } catch (error) {
            console.error('Error updating mocion:', error);
        }
    };

    return (
        <div>
            <h2>Editar Moción</h2>
            <form onSubmit={handleSubmit}>
                <div>
                    <label>Topico:</label>
                    <input
                        type="text"
                        value={topico}
                        onChange={(e) => setTopico(e.target.value)}
                    />
                </div>
                <div>
                    <label>Tiempo por Delegado:</label>
                    <input
                        type="number"
                        value={tiempoDel}
                        onChange={(e) => setTiempoDel(e.target.value)}
                    />
                </div>
                <div>
                    <label>Cantidad de Delegados:</label>
                    <input
                        type="number"
                        value={cantDel}
                        onChange={(e) => setCantDel(e.target.value)}
                    />
                </div>
                <div>
                    <label>Sesion:</label>
                    <input
                        type="text"
                        value={sesion}
                        onChange={(e) => setSesion(e.target.value)}
                    />
                </div>
                <div>
                    <label>Fecha:</label>
                    <input
                        type="date"
                        value={fecha}
                        onChange={(e) => setFecha(e.target.value)}
                    />
                </div>
                <div>
                    <label>Delegado:</label>
                    <select
                        value={delegadoId}
                        onChange={(e) => setDelegadoId(e.target.value)}
                    >
                        <option value="">Selecciona un delegado</option>
                        {delegados.map((delegado) => (
                            <option key={delegado.ID} value={delegado.ID}>
                                {delegado.Nombre} {delegado.Apellido}
                            </option>
                        ))}
                    </select>
                </div>
                <div>
                    <label>Comite:</label>
                    <select
                        value={comiteId}
                        onChange={(e) => setComiteId(e.target.value)}
                    >
                        <option value="">Selecciona un comité</option>
                        {comites.map((comite) => (
                            <option key={comite.ID} value={comite.ID}>
                                {comite.Topico}
                            </option>
                        ))}
                    </select>
                </div>
                <button type="submit">Guardar Cambios</button>
            </form>
        </div>
    );
};

export default EditMocion;
